        <script>H5PIntegration = {"ajax":{"setFinished":"","contentUserData":""},"ajaxPath":"/h5p/ajax?action=","contents":{"cid-3781372852":{"displayOptions":{"copy":false,"copyright":true,"embed":false,"export":false,"frame":true,"icon":false},"fullScreen":"0","jsonContent":"{\"content\":[{\"content\":{\"params\":{\"presentation\":{\"slides\":[{\"elements\":[{\"x\":1.4903129657228,\"y\":2.9411764705882,\"width\":50.452061698957,\"height\":8.3921570588235,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#c0392b\\\"><strong>1- Why is reproduction important?</strong></span></p>\\n\"},\"subContentId\":\"bdf51e1e-ebad-410c-9906-6cb7b700825e\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.4903129657228,\"y\":8.8235294117647,\"width\":98.291107898659,\"height\":26.039215882353,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Living things grow and change. During their lifetime, they perform functions aiming at keeping them alive. These functions include nutrition and respiration and they are called <span style=\\\"color:#c0392b\\\"><strong>vital functions</strong></span>..</p>\\n\"},\"subContentId\":\"f982b61f-1513-4673-a08d-d4cc1f8755f3\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.485345752608,\"y\":35.225588235294,\"width\":44.490809836066,\"height\":64.27451,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Living things<strong><span style=\\\"color:#c0392b\\\"> grow</span></strong> and change. <strong>Respiration</strong> and <strong>nutrition</strong> are necessary functions performed by all living things to stay alive. They are called <span style=\\\"color:#c0392b\\\"><strong>vital functions</strong></span>.<br />\\nNo matter how long a living thing lives, it will eventually die. This is why it needs to produce new organisms similar to itself through <strong><span style=\\\"color:#c0392b\\\">reproduction</span></strong>. This function is vital to groups of living things because it prevents them of becoming <strong><span style=\\\"color:#c0392b\\\">extinct</span></strong> and it ensures the <strong><span style=\\\"color:#c0392b\\\">continuity</span></strong> of life.</p>\\n\"},\"subContentId\":\"0a9ba0b3-9818-45f6-a7e8-cb53559bd975\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":49.329359165425,\"y\":26.470588235294,\"width\":50.452061698957,\"height\":60.450980588235,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4R50RXhpZgAATU0AKgAAAAgABwESAAMAAAABAAEAAAEaAAUAAAABAAAAYgEbAAUAAAABAAAAagEoAAMAAAABAAIAAAExAAIAAAAeAAAAcgEyAAIAAAAUAAAAkIdpAAQAAAABAAAApAAAANAACvyAAAAnEAAK/IAAACcQQWRvYmUgUGhvdG9zaG9wIENTNiAoV2luZG93cykAMjAyMDowMTowNCAxMjowMzoxNAAAA6ABAAMAAAABAAEAAKACAAQAAAABAAAEoqADAAQAAAABAAACzQAAAAAAAAAGAQMAAwAAAAEABgAAARoABQAAAAEAAAEeARsABQAAAAEAAAEmASgAAwAAAAEAAgAAAgEABAAAAAEAAAEuAgIABAAAAAEAAB0+AAAAAAAAAEgAAAABAAAASAAAAAH/2P/iDFhJQ0NfUFJPRklMRQABAQAADEhMaW5vAhAAAG1udHJSR0IgWFlaIAfOAAIACQAGADEAAGFjc3BNU0ZUAAAAAElFQyBzUkdCAAAAAAAAAAAAAAAAAAD21gABAAAAANMtSFAgIAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAEWNwcnQAAAFQAAAAM2Rlc2MAAAGEAAAAbHd0cHQAAAHwAAAAFGJrcHQAAAIEAAAAFHJYWVoAAAIYAAA -48eb-90f5-1aaac1ff339f\",\"metadata\":{\"contentType\":\"Shapes\",\"license\":\"U\"}},\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false},{\"x\":1.4903129657228,\"y\":2.9411764705882,\"width\":93.671137704918,\"height\":39.862745294118,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Most organisms start from one cell which is a result of<strong> reproduction.</strong></p>\\n\\n<p>There are two types of reproduction: <strong><span style=\\\"color:#c0392b\\\">Sexual Reproduction</span></strong> and <strong><span style=\\\"color:#c0392b\\\">Asexual Reproduction.</span></strong></p>\\n\"},\"subContentId\":\"f99eff60-0615-400d-bfff-9d1eb0c5bab4\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.9806259314456,\"y\":23.529411764706,\"width\":43.000496870343,\"height\":73.098039411765,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#c0392b\\\"><strong>Sexual reproduction</strong></span></p>\\n\\n<ul>\\n\\t<li>Requires two parents: one male and one female</li>\\n\\t<li>Involves fertilization (the union of a male sex cell and a female sex cell).</li>\\n\\t<li>Occurs in complex multicellular organisms, such as mammals, birds, fish, insects and plants.</li>\\n\\t<li>Offspring are not an exact copy of the parents.</li>\\n</ul>\\n\\n<p></p>\\n\"},\"subContentId\":\"fd920fcb-aa58-48f1-b601-c1360992ea81\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":53.796751199635594,\"y\":23.529411764706,\"width\":45.981122801788,\"height\":67.215686470588,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#c0392b\\\"><strong>Asexual Reproduction</strong></span></p>\\n\\n<ul>\\n\\t<li>Only one parent is necessary.</li>\\n\\t<li>Does not involve fertilization.</li>\\n\\t<li>Occurs in lower living things like bacteria, yeast and plants.</li>\\n\\t<li>Budding, fission, and vegetative propagation are examples of asexual reproduction</li>\\n\\t<li>Offspring are identical to parent.</li>\\n</ul>\\n\"},\"subContentId\":\"21ac1482-70b7-4583-a92e-11b1081055eb\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":2.9806259314456,\"y\":5.8823529411765,\"width\":40,\"height\":40,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Fertilzation (Sexual reproduction)</strong></p>\\n\"},\"subContentId\":\"b34dfc30-4a90-48a0-a26b-b95f58ebceea\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":0,\"y\":23.34834834834835,\"width\":99.77710243161094,\"height\":30.190190390390388,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4QeXRXhpZgAATU0AKgAAAAgABwESAAMAAAABAAEAAAEaAAUAAAABAAAAYgEbAAUAAAABAAAAagEoAAMAAAABAAIAAAExAAIAAAAeAAAAcgEyAAIAAAAUAAAAkIdpAAQAAAABAAAApAAAANAACvyAAAAnEAAK/IAAACcQQWRvYmUgUGhvdG9zaG9wIENTNiAoV2luZG93cykAMjAyMDowMjowMyA
